import React from "react";
import crash from '../image/crash.png';
import roulette from '../image/rullete.jpg';
import raffle from '../image/loterie.webp';

const history = useHistory();

const handleClick = () => {
  history.push("/crash");
};

function Home() {
  return (
    
    <div >
        <div class="pagesGame">
          <div class="poza1" onClick={handleClick}></div>
          <div class="poza2"></div>
          <div class="poza3"></div>
        
      </div>
    </div>
  );
}

export default Home;
